import Login from './Login'
import Nav from './Nav'
import React, { useState, useEffect } from 'react';
const Main = (props) =>{
   
    useEffect()

    
    const isLoggedView = () =>{
        if (props.isLogged===true){
        return(
            <div>
                <Nav/>
            </div>
        )
    }
    return(
            <div>
                <Login username={props.username} setUsername={props.setUsername} setIsLogged={props.setIsLogged}/>
            </div>
        )
    }

    
    
}

export default Main;
